import React, {Component} from 'react';
import {Form, Input, Label, Button, Row, Col} from 'reactstrap';
//import "./SignIn.css";

class SignIn extends Component {

  render(){

    return(
          <div className='center'>
            <Label>Email: </Label>
            <Input label='Email: ' type='text' bsSize='lg' style={{border: '2px solid #000000'}}/>
            <div style={{height: '0.4em'}}/>
            <Label>Username: </Label>
            <Input type='text' bsSize='lg' style={{border: '2px solid #000000'}}/>
            <div style={{height: '0.4em'}}/>
            <Label>Password: </Label>
            <Input type='text' size='md' bsSize='large' style={{border: '2px solid #000000'}}/>
          </div>
    );
  }

}

export default SignIn;
